--getgenv().run_on_thread = nil;
--getgenv().getactorthreads = nil;

local Services = setmetatable({}, {
    __index = function(Self, Index)
        return cloneref(game.GetService(game, Index));
    end
});

local TeleportService = Services.TeleportService;
local Players = Services.Players;

local LocalPlayer = Players.LocalPlayer;
local PlaceId, JobId = game.PlaceId, game.JobId;

local QueueOnTeleport = queue_on_teleport or queueonteleport;

local RunOnThread = run_on_thread or runonthread;
local RunOnActor = run_on_actor or RunOnActor;

local GetActorThreads = getactorthreads or get_actor_threads;
local PrioritizedFunction = (RunOnThread or RunOnActor);

local GetNeeded = PrioritizedFunction and (GetActorThreads or (function()
    return getdeletedactors or function()
        local Actors = { };

        for _, Descendant in game:GetDescendants() do
            if (Descendant.ClassName ~= "Actor") then
                continue;
            end

            table.insert(Actors, Descendant);
        end

        return Actors;
    end
end)()) or { };

if ((not RunOnActor) and (not RunOnThread)) then
    if (QueueOnTeleport) then
        (setfflag or function() end)("DebugRunParallelLuaOnMainThread", "True");

        QueueOnTeleport([[
            local Players = cloneref(game:GetService("Players"));

            while (not Players.LocalPlayer) do
                task.wait();
            end

            loadstring(string.match(game:HttpGet("https://raw.githubusercontent.com/dementiaenjoyer/homohack/refs/heads/main/pf_main.lua"), "%[%=%=%=%[(.-)%]%=%=%=%]"))();
        ]]);

        TeleportService:TeleportToPlaceInstance(PlaceId, JobId, LocalPlayer, nil, nil, nil);
        return TeleportService:Teleport(PlaceId, LocalPlayer, nil, nil);
    end

    (setclipboard or function() end)("https://www.youtube.com/watch?v=wr__SjSUjAU");
    return LocalPlayer:Kick("Couldn't find an actor or a thread to run script on. Here's a youtube video on how to fix / get around this: https://www.youtube.com/watch?v=wr__SjSUjAU (REMOVE THE FFLAG AFTER YOU'RE DONE PLAYING, SOME GAMES BAN YOU FOR IT)");
end

local Actor = GetNeeded()[1];

if (not Actor) then
    return;
end

